function Header() {
    return (
        <header class="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-body border-bottom shadow-sm">
        <p class="h5 my-0 me-md-auto fw-normal">Vulcan</p>
        <nav class="my-2 my-md-0 me-md-3">
          <a class="p-2 text-dark" href="https://www.google.com/">Explore</a>
          <a class="btn btn-outline-primary" href="https://www.google.com/">Servie PRO</a>
          <a class="p-2 text-dark" href="https://www.google.com/">Customer</a>
        </nav>
        <a class="btn btn-outline-primary" href="https://www.google.com/">Login</a>
      </header>
    )
  }

  export default Header;
